import React, { Component } from 'react';
import Header from '../../components/Header/Header';
import Footer from '../../components/Footer/Footer';
import SideBar from '../../components/SideBar/SideBar';
import axios from 'axios';
import {storage} from '../../firebase';

class AddProduct extends Component {
    constructor(props) {
        super(props);
        this.state = {
            id:"",
            name: "",
            price: "",
            discount:"",
            description:"",
            service_category_id:"",
            vendor_id: "",
            user:[]
        }

        var retrievedData = localStorage.getItem("User");
        var user = JSON.parse(retrievedData);
        this.state.id = user[0].id;
    }

    componentDidMount() {
        axios.get('admin_product/'+this.state.id)
        .then(res => {
            this.setState({
                products: res.data.data 
            });
        })
        .catch((error) => {
        console.log(error);
        })
    }

  render() {
    return (
        <div className="container-scroller">
            <Header/>
            <div className="container-fluid page-body-wrapper">
                <SideBar/>
                <div className="main-panel">
                    <div className="content-wrapper">
                        <div className="page-header">
                            <h3 className="page-title">
                                <span className="page-title-icon bg-gradient-primary text-white mr-2">
                                <i className="mdi mdi-basket menu-icon" />
                                </span> Quản lí sản phẩm - Thêm mới sản phẩm
                            </h3>
                        </div>
                        <div className="card">
                            <div className="card-body">
                
                            </div>
                        </div>
                    </div>
                    <Footer/>
                </div>
            </div>
        </div> 
    )
  }
}

export default AddProduct;
